import React from 'react';
import style from './Website.module.css';

const Website = () => {
  const userName = [
    {
      userImage:
        'https://www.pnp.ru/upload/entities/2019/12/18/article/detailPicture/90/ac/96/c7/28dc349f219c5ff70af0b64bbae3632b.jpg',
      user: 'Alina Kartyshova',
      marks:
        'https://img2.freepng.ru/20180420/wzw/kisspng-computer-icons-check-mark-5ad9cf6f0a5050.4721703615242238550423.jpg',
      description: 'Description',
      heart: '',
    },
  ];
  return (
    <div className={style.main}>
      <div className={style.user_info}>
        <img
          className={style.user_image}
          src="https://www.pnp.ru/upload/entities/2019/12/18/article/detailPicture/90/ac/96/c7/28dc349f219c5ff70af0b64bbae3632b.jpg"
          alt="user image"
        />
        <div className={style.user}>Alina Kartyshova</div>
        <img
          className={style.marks}
          src="https://img2.freepng.ru/20180420/wzw/kisspng-computer-icons-check-mark-5ad9cf6f0a5050.4721703615242238550423.jpg"
          alt="chekmarks"
        />
      </div>
      <div className={style.content}>
        <div className={style.description}>Aspire to inspire. Imagination rules the world</div>
        <img
          className={style.heart}
          src="https://images.wallpaperscraft.ru/image/derevo_serdtse_fotoshop_pole_trava_romantika_96219_1280x1280.jpg"
          alt="heart"
        />
      </div>
      <div className={style.group_like}>
        <div className={style.like}>Like 30000</div>
        <div className={style.like}>Comments 500</div>
        <div>Reposts 20</div>
      </div>
    </div>
  );
};

export default Website;
